                'name' => '{"en":"Art and Design","hi":"\\u0915\\u0932\\u093e \\u0914\\u0930 \\u0921\\u093f\\u091c\\u093c\\u093e\\u0907\\u0928","ar":"\\u0644\\u0641\\u0646 \\u0648\\u0627\\u0644\\u062a\\u0635\\u0645\\u064a\\u0645"}',
                'description' => '{"en":"Art and Design encompasses various forms of visual expression, creativity, and aesthetic principles. It includes disciplines such as painting, sculpture, graphic design, fashion design, and architecture. Artists and designers use their skills and imagination to communicate ideas, evoke emotions, and inspire audiences.","hi":"\\u0915\\u0932\\u093e \\u0914\\u0930 \\u0921\\u093f\\u091c\\u093c\\u093e\\u0907\\u0928 \\u0935\\u093f\\u092d\\u093f\\u0928\\u094d\\u0928 \\u092a\\u094d\\u0930\\u0915\\u093e\\u0930 \\u0915\\u0947 \\u0926\\u0943\\u0936\\u094d\\u092f \\u0938\\u0902\\u0935\\u0947\\u0926\\u0928\\u0936\\u0940\\u0932\\u0924\\u093e, \\u0930\\u091a\\u0928\\u093e\\u0924\\u094d\\u092e\\u0915\\u0924\\u093e, \\u0914\\u0930 \\u0938\\u094c\\u0928\\u094d\\u0926\\u0930\\u094d\\u092f \\u0938\\u093f\\u0926\\u094d\\u0927\\u093e\\u0902\\u0924\\u094b\\u0902 \\u0915\\u094b \\u0938\\u092e\\u093e\\u0939\\u093f\\u0924 \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948\\u0964 \\u0907\\u0938\\u092e\\u0947\\u0902 \\u092a\\u0947\\u0902\\u091f\\u093f\\u0902\\u0917, \\u092e\\u0942\\u0930\\u094d\\u0924\\u093f\\u0915\\u0932\\u093e, \\u0917\\u094d\\u0930\\u093e\\u092b\\u093f\\u0915 \\u0921\\u093f\\u091c\\u093c\\u093e\\u0907\\u0928, \\u092b\\u0948\\u0936\\u0928 \\u0921\\u093f\\u091c\\u093c\\u093e\\u0907\\u0928, \\u0914\\u0930 \\u0906\\u0930\\u094d\\u0915\\u093f\\u091f\\u0947\\u0915\\u094d\\u091a\\u0930 \\u091c\\u0948\\u0938\\u0947 \\u0935\\u093f\\u0937\\u092f \\u0936\\u093e\\u092e\\u093f\\u0932 \\u0939\\u0948\\u0902\\u0964 \\u0915\\u0932\\u093e\\u0915\\u093e\\u0930\\u094b\\u0902 \\u0914\\u0930 \\u0921\\u093f\\u091c\\u093c\\u093e\\u0907\\u0928\\u0930\\u094d\\u0938 \\u0905\\u092a\\u0928\\u0947 \\u0915\\u094c\\u0936\\u0932 \\u0914\\u0930 \\u0915\\u0932\\u094d\\u092a\\u0928\\u093e \\u0915\\u093e \\u0909\\u092a\\u092f\\u094b\\u0917 \\u0915\\u0930\\u0915\\u0947 \\u0935\\u093f\\u091a\\u093e\\u0930\\u094b\\u0902 \\u0915\\u094b \\u0938\\u0902\\u0935\\u0939\\u0928\\u0940 \\u0915\\u0930\\u0924\\u0947 \\u0939\\u0948\\u0902, \\u092d\\u093e\\u0935\\u0928\\u093e\\u0913\\u0902 \\u0915\\u094b \\u0909\\u0924\\u094d\\u0924\\u0947\\u091c\\u093f\\u0924 \\u0915\\u0930\\u0924\\u0947 \\u0939\\u0948\\u0902, \\u0914\\u0930 \\u0926\\u0930\\u094d\\u0936\\u0915\\u094b\\u0902 \\u0915\\u094b \\u092a\\u094d\\u0930\\u0947\\u0930\\u093f\\u0924 \\u0915\\u0930\\u0924\\u0947 \\u0939\\u0948\\u0902\\u0964","ar":"\\u064a\\u0634\\u0645\\u0644 \\u0627\\u0644\\u0641\\u0646 \\u0648\\u0627\\u0644\\u062a\\u0635\\u0645\\u064a\\u0645 \\u0645\\u062c\\u0645\\u0648\\u0639\\u0629 \\u0645\\u062a\\u0646\\u0648\\u0639\\u0629 \\u0645\\u0646 \\u0623\\u0634\\u0643\\u0627\\u0644 \\u0627\\u0644\\u062a\\u0639\\u0628\\u064a\\u0631 \\u0627\\u0644\\u0628\\u0635\\u0631\\u064a\\u060c \\u0648\\u0627\\u0644\\u0625\\u0628\\u062f\\u0627\\u0639\\u060c \\u0648\\u0645\\u0628\\u0627\\u062f\\u0626 \\u0627\\u0644\\u062c\\u0645\\u0627\\u0644\\u064a\\u0629. \\u064a\\u0634\\u0645\\u0644 \\u0630\\u0644\\u0643 \\u0627\\u0644\\u062a\\u062e\\u0635\\u0635\\u0627\\u062a \\u0645\\u062b\\u0644 \\u0627\\u0644\\u0631\\u0633\\u0645\\u060c \\u0648\\u0627\\u0644\\u0646\\u062d\\u062a\\u060c \\u0648\\u062a\\u0635\\u0645\\u064a\\u0645 \\u0627\\u0644\\u062c\\u0631\\u0627\\u0641\\u064a\\u0643\\u060c \\u0648\\u062a\\u0635\\u0645\\u064a\\u0645 \\u0627\\u0644\\u0623\\u0632\\u064a\\u0627\\u0621\\u060c \\u0648\\u0627\\u0644\\u0647\\u0646\\u062f\\u0633\\u0629 \\u0627\\u0644\\u0645\\u0639\\u0645\\u0627\\u0631\\u064a\\u0629. \\u064a\\u0633\\u062a\\u062e\\u062f\\u0645 \\u0627\\u0644\\u0641\\u0646\\u0627\\u0646\\u0648\\u0646 \\u0648\\u0627\\u0644\\u0645\\u0635\\u0645\\u0645\\u0648\\u0646 \\u0645\\u0647\\u0627\\u0631\\u0627\\u062a\\u0647\\u0645 \\u0648\\u062e\\u064a\\u0627\\u0644\\u0647\\u0645 \\u0644\\u0646\\u0642\\u0644 \\u0627\\u0644\\u0623\\u0641\\u0643\\u0627\\u0631\\u060c \\u0648\\u0625\\u062b\\u0627\\u0631\\u0629 \\u0627\\u0644\\u0639\\u0648\\u0627\\u0637\\u0641\\u060c \\u0648\\u0625\\u0644\\u0647\\u0627\\u0645 \\u0627\\u06