                'description' => '{"en":"Environmental Studies is an interdisciplinary field that examines the interactions between humans and the environment. It encompasses various aspects such as ecology, conservation, sustainability, pollution control, and environmental policy. Environmental studies aim to understand the complex relationships within ecosystems and address environmental challenges to promote a more sustainable and harmonious relationship between humans and the natural world.","hi":"\\u092a\\u0930\\u094d\\u092f\\u093e\\u0935\\u0930\\u0923 \\u0905\\u0927\\u094d\\u092f\\u092f\\u0928 \\u090f\\u0915 \\u092c\\u0939\\u0941\\u0935\\u093f\\u0926\\u094d\\u092f\\u093e\\u0924\\u094d\\u092e\\u0915 \\u0915\\u094d\\u0937\\u0947\\u0924\\u094d\\u0930 \\u0939\\u0948 \\u091c\\u094b \\u092e\\u093e\\u0928\\u0935 \\u0914\\u0930 \\u092a\\u0930\\u094d\\u092f\\u093e\\u0935\\u0930\\u0923 \\u0915\\u0947 \\u092c\\u0940\\u091a \\u0938\\u0902\\u0935\\u093e\\u0926 \\u0915\\u0940 \\u0905\\u0927\\u094d\\u092f\\u092f\\u0928 \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948\\u0964 \\u0907\\u0938\\u092e\\u0947\\u0902 \\u092a\\u093e\\u0930\\u093f\\u0938\\u094d\\u0925\\u093f\\u0924\\u093f\\u0915\\u0940, \\u0938\\u0902\\u0930\\u0915\\u094d\\u0937\\u0923, \\u0938\\u0902\\u091a\\u092f\\u0940\\u0924\\u093e, \\u092a\\u094d\\u0930\\u0926\\u0942\\u0937\\u0923 \\u0928\\u093f\\u092f\\u0902\\u0924\\u094d\\u0930\\u0923, \\u0914\\u0930 \\u092a\\u0930\\u094d\\u092f\\u093e\\u0935\\u0930\\u0923 \\u0928\\u0940\\u0924\\u093f \\u091c\\u0948\\u0938\\u0947 \\u0935\\u093f\\u092d\\u093f\\u0928\\u094d\\u0928 \\u092a\\u0939\\u0932\\u0941\\u0913\\u0902 \\u0915\\u094b \\u0936\\u093e\\u092e\\u093f\\u0932 \\u0915\\u093f\\u092f\\u093e \\u0917\\u092f\\u093e \\u0939\\u0948\\u0964 \\u092a\\u0930\\u094d\\u092f\\u093e\\u0935\\u0930\\u0923 \\u0905\\u0927\\u094d\\u092f\\u092f\\u0928 \\u0915\\u093e \\u0909\\u0926\\u094d\\u0926\\u0947\\u0936\\u094d\\u092f \\u092a\\u093e\\u0930\\u093f\\u0938\\u094d\\u0925\\u093f\\u0924\\u093f\\