                'name' => '{"en":"Political Science","hi":"\\u0930\\u093e\\u091c\\u0928\\u0940\\u0924\\u093f \\u0935\\u093f\\u091c\\u094d\\u091e\\u093e\\u0928","ar":"\\u0639\\u0644\\u0645 \\u0627\\u0644\\u0633\\u064a\\u0627\\u0633\\u0629"}',
                'description' => '{"en":"Political Science is the study of government systems, political behavior, political ideologies, and public policies. It examines the structure and functioning of political institutions, international relations, political processes, and power dynamics within societies. Political scientists analyze political phenomena to understand and explain political phenomena and to contribute to informed decision-making in governance.","hi":"\\u0930\\u093e\\u091c\\u0928\\u0940\\u0924\\u093f \\u0935\\u093f\\u091c\\u094d\\u091e\\u093e\\u0928 \\u0938\\u0930\\u0915\\u093e\\u0930\\u0940 \\u0924\\u0902\\u0924\\u094d\\u0930\\u094b\\u0902, \\u0930\\u093e\\u091c\\u0928\\u0940\\u0924\\u093f\\u0915 \\u0935\\u094d\\u092f\\u0935\\u0939\\u093e\\u0930, \\u0930\\u093e\\u091c\\u0928\\u0940\\u0924\\u093f\\u0915 \\u0935\\u093f\\u091a\\u093e\\u0930\\u0927\\u093e\\u0930\\u093e\\u0913\\u0902, \\u0914\\u0930 \\u0938\\u093e\\u0930\\u094d\\u0935\\u091c\\u0928\\u093f\\u0915 \\u0928\\u0940\\u0924\\u093f\\u092f\\u094b\\u0902 \\u0915\\u093e \\u0905\\u0927\\u094d\\u092f\\u092f\\u0928 \\u0939\\u0948\\u0964 \\u0907\\u0938\\u092e\\u0947\\u0902 \\u0930\\u093e\\u091c\\u0928\\u0940\\u0924\\u093f\\u0915 \\u0938\\u0902\\u0938\\u094d\\u0925\\u093e\\u0913\\u0902, \\u0905\\u0902\\u0924\\u0930\\u094d\\u0930\\u093e\\u0937\\u094d\\u091f\\u094d\\u0930\\u0940\\u092f \\u0938\\u0902\\u092c\\u0902\\u0927, \\u0930\\u093e\\u091c\\u0928\\u0940\\u0924\\u093f\\u0915 \\u092a\\u094d\\u0930\\u0915\\u094d\\u0930\\u093f\\u092f\\u093e\\u090f\\u0901, \\u0914\\u0930 \\u0938\\u092e\\u093e\\u091c\\u094b\\u0902 \\u092e\\u0947\\u0902 \\u0936\\u0915\\u094d\\u0924\\u093f \\u0917\\u0924\\u093f\\u0915\\u0940 \\u0915\\u0940 \\u0938\\u0902\\u0930\\u091a\\u0928\\u093e \\u0914\\u0930 \\u0915\\u093e\\u0930\\u094d\\u092f\\u093e\\u0928\\u094d\\u0935\\u092f\\u0928 \\u0915\\u0940 \\u091c\\u093e\\u0902\\u091a \\u0915\\u0940 \\u091c\\u093e\\u0924\\u0940 \\u0939\\u0948\\u0964 \\u0930\\u093e\\u091c\\u0928\\u0940\\u0924\\u093f\\u091c\\u094d\\u091e \\u0930\\u093e\\u091c\\u0928\\u0940\\u0924\\u093f\\u0915 \\u0918\\u091f\\u0928\\u093e\\u0913\\u0902 \\u0915\\u093e \\u0935\\u093f\\u0936\\u094d\\u0932\\u0947\\u0937\\u0923 \\u0915\\u0930\\u0924\\u0947 \\u0939\\u0948\\u0902 \\u0924\\u093e\\u0915\\u093f \\u0930\\u093e\\u091c\\u0928\\u0940\\u0924\\u093f\\u0915 \\u0918\\u091f\\u0928\\u093e\\u0913\\u0902 \\u0915\\u094b \\u0938\\u092e\\u091d\\u093e \\u0914\\u0930 \\u0938\\u094d\\u092a\\u0937\\u094d\\u091f\\u0940\\u0915\\u0943\\u0924 \\u0915\\u093f\\u092f\\u093e \\u091c\\u093e \\u0938\\u0915\\u0947 \\u0914\\u0930 \\u0936\\u093e\\u0938\\u0928 \\u092e\\u0947\\u0902 \\u0938\\u0942\\u091a\\u093f\\u0924 \\u0928\\u093f\\u0930\\u094d\\u0923\\u092f \\u0932\\u0947\\u0928\\u0947 \\u092e\\u0947\\u0902 \\u092f\\u094b\\u0917\\u0926\\u093e\\u0928 \\u0915\\u093f\\u092f\\u093e \\u091c\\u093e \\u0938\\u0915\\u0947\\u0964","ar":"\\u0639\\u0644\\u0645 \\u0627\\u0644\\u0633\\u064a\\u0627\\u0633\\u0629 \\u0647\\u0648 \\u062f\\u0631\\u0627\\u0633\\u0629 \\u0623\\u0646\\u0638\\u0645\\u0629 \\u0627\\u0644\\u062d\\u0643\\u0648\\u0645\\u0629\\u060c \\u0648\\u0627\\u0644\\u0633\\u0644\\u0648\\u0643 \\u0627\\u0644\\u0633\\u064a\\u0627\\u0633\\u064a\\u060c \\u0648\\u0627\\u0644\\u0623\\u064a\\u062f\\u064a\\u0648\\u0644\\u0648\\u062c\\u064a\\u0627\\u062a \\u0627\\u0644\\u0633\\u064a\\u0627\\u0633\\u064a\\u0629\\u060c \\u0648\\u0627\\u0644\\u0633\\u064a\\u0627\\u0633\\u0627\\u062a \\u0627\\u0644\\u0639\\u0627\\u0645\\u0629. \\u064a\\u0641\\u062d\\u0635 \\u0627\\u0644\\u0628\\u0646\\u064a\\u0629 \\u0648\\u0648\\u0638\\u064a\\u0641\\u0629 \\u0627\\u0644\\u0645\\u0624\\u0633\\u0633\\u0627\\u062a \\u0627\\u0644\\u0633\\u064a\\u0627\\u0633\\u064a\\u0629\\u060c \\u0648\\u0627\\u0644\\u0639\\u0644\\u0627\\u0642\\u0627\\u062a \\u0627\\u0644\\u062f\\u0648\\u0644\\u064a\\u0629\\u060c \\u0648\\u0627\\u0644\\u0639\\u0645\\u0644\\u064a\\u0627\\u062a \\u0627\\u0644\\u0633\\u064a\\u0627\\u0633\\u064a\\u0629\\u060c \\u0648\\u062f\\u064a\\u064